import React, { Component } from "react";

class Message extends Component {
  render() {
    switch (this.props.msg) {
      case "greet":
        return <h1 className="greet">HOW COOL IS THAT!?</h1>;
      case "gw":
        return (
          <div className="gw">
            <h1>Game Won</h1>
          </div>
        );
      case "go":
        return (
          <div className="gw">
            <h1>Game Over</h1>
          </div>
        );
      default:
        return null;
    }
  }
}

export default Message;
